    let tabletItemId = addInvenotry[0].itemId;
    let sdCardItemId = addInvenotry[1].itemId;
    const addInvenotryInCsv = new Parser({
      fields: ["skuId", "itemId", "batchId", "warehouseId", "category", "serialNumber", "imeiNumber"]
    }).parse(addInvenotry);
    fs.writeFileSync(filePath, addInvenotryInCsv);
    await this.btnChooseFile.waitForClickable({
