        // console.log('success or undefined?' + ids);

        // let status = $("//span[@class='text-uppercase badge bg-success']").getText();
        // console.log('success or undefined?' + status);
        // let id = $("(//td)[27]").getText();
        // let ids = $("(//td)[28]").getText();
    }) 

